<style>

html, body { min-height:100%; }
body {
padding: 0 0 0px;

/* Gate One black theme */
@font-face {
  font-family: 'Ubuntu Mono';
  font-style: normal;
  font-weight: bold;
  src: local('Ubuntu Mono Bold'), local('UbuntuMono-Bold'), url('/static/ubuntumono-bold.woff') format('woff');
}
@font-face {
  font-family: 'Ubuntu Mono';
  font-style: normal;
  font-weight: normal;
  src: local('Ubuntu Mono'), local('UbuntuMono-Regular'), url('/static/ubuntumono-normal.woff') format('woff');
}
@font-face {
  font-family: 'Ubuntu Mono';
  font-style: italic;
  font-weight: bold;
  src: local('Ubuntu Mono Bold Italic'), local('UbuntuMono-BoldItalic'), url('/static/ubuntumono-bold-italic.woff') format('woff');
}
@font-face {
  font-family: 'Ubuntu Mono';
  font-style: italic;
  font-weight: normal;
  src: local('Ubuntu Mono Italic'), local('UbuntuMono-Italic'), url('/static/ubuntumono-italic.woff') format('woff');
}
hr {
    margin: 0;
    padding: 0;
}
#gateone {
    position: absolute;
    overflow: hidden;
    background-color: transparent;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    padding: 0;
    z-index: 0;
    font-size: 1em;
    /* WebKit */
    -webkit-transform-origin: top right;
    -webkit-transition: all 1s ease-in-out;
    /* Firefox */
    -moz-transition: all 1s ease-in-out;
    -moz-transform-origin: top right;
    /* Opera */
    -o-transition-property: all;
    -o-transition-duration: 1s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    /* IE 9+ */
    -ms-transform-origin: top right;
    -ms-transition: all 1s ease-in-out;
    /* Future CSS3 standard */
    transform-origin: top right;
    transition: all 1s ease-in-out;
}
#gateone .pointer {
    cursor: pointer;
}
#gateone .about_gateone ul {
    list-style-type: none;
    padding-left: 1.5em;
    padding-top: 0.5em;
    padding-bottom: 0.5em;
}
#gateone .about_gateone li:before {
    content: &quot;éˆ³?&quot;;
}
#gateone .centertrans { /* Just sets the transform-origin to &quot;center center&quot; */
    -webkit-transform-origin: center center;
    -moz-transform-origin: center center;
    -o-transform-origin: center center;
    -ms-transform-origin: center center;
    transform-origin: center center;
}
#gateone .toprighttrans { /* Just sets the transform-origin to &quot;top right&quot; */
    -webkit-transform-origin: top right;
    -moz-transform-origin: top right;
    -o-transform-origin: top right;
    -ms-transform-origin: top right;
    transform-origin: top right;
}
#gateone .twosectrans {
    -webkit-transform-origin: top right;
    -webkit-transition: all 2s ease-in-out;
    -moz-transition: all 2s ease-in-out;
    -moz-transform-origin: top right;
    -o-transition-property: all;
    -o-transition-duration: 2s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    -ms-transform-origin: top right;
    -ms-transition: all 2s ease-in-out;
    transform-origin: top right;
    transition: all 2s ease-in-out;
}
#gateone .sectrans {
    -webkit-transform-origin: top right;
    -webkit-transition: all 1s ease-in-out;
    -moz-transition: all 1s ease-in-out;
    -moz-transform-origin: top right;
    -o-transition-property: all;
    -o-transition-duration: 1s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    -ms-transform-origin: top right;
    -ms-transition: all 1s ease-in-out;
    transform-origin: top right;
    transition: all 1s ease-in-out;
}
#gateone .sectransform {
    /* For only transform effects */
    -webkit-transform-origin: top right;
    -webkit-transition: -webkit-transform 1s ease-in-out;
    -moz-transition: -moz-transform 1s ease-in-out;
    -moz-transform-origin: top right;
    -o-transition-property: -o-transform;
    -o-transition-duration: 1s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    -ms-transform-origin: top right;
    -ms-transition: -ms-transform 1s ease-in-out;
    transform-origin: top right;
    transition: transform 1s ease-in-out;
}
#gateone .halfsectrans {
    -webkit-transform-origin: top right;
    -webkit-transition: all 0.5s ease-in-out;
    -moz-transition: all 0.5s ease-in-out;
    -moz-transform-origin: top right;
    -o-transition-property: all;
    -o-transition-duration: 0.5s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    -ms-transform-origin: top right;
    -ms-transition: all 0.5s ease-in-out;
    transform-origin: top right;
    transition: all 0.5s ease-in-out;
}
#gateone .quartersectrans {
    -webkit-transform-origin: top right;
    -webkit-transition: all 0.25s ease-in-out;
    -moz-transition: all 0.25s ease-in-out;
    -moz-transform-origin: top right;
    -o-transition-property: all;
    -o-transition-duration: 0.25s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: right top;
    -ms-transform-origin: top right;
    -ms-transition: all 0.25s ease-in-out;
    transform-origin: top right;
    transition: all 0.25s ease-in-out;
}
#gateone .superfasttrans {
    -webkit-transform-origin: top left;
    -webkit-transition: all 0.1s ease-in-out;
    -moz-transition: all 0.1s ease-in-out;
    -moz-transform-origin: top left;
    -o-transition-property: all;
    -o-transition-duration: 0.1s;
    -o-transition-timing-function: ease-in-out;
    -o-transform-origin: left top;
    -ms-transform-origin: top right;
    -ms-transition: all 0.1s ease-in-out;
    transform-origin: top left;
    transition: all 0.1s ease-in-out;
}
#gateone .origintopmiddle {
    -webkit-transform-origin: 50% 0;
    -moz-transform-origin: 50% 0;
    -ms-transform-origin: 50% 0;
    -o-transform-origin: 50% 0;
    transform-origin: 50% 0;
}
#gateone .originbottommiddle {
    -webkit-transform-origin: 50% 100%;
    -moz-transform-origin: 50% 100%;
    -ms-transform-origin: 50% 100%;
    -o-transform-origin: 50% 100%;
    transform-origin: 50% 100%;
}
#gateone textarea {
    background-color: #fff;
    outline: none;
    resize: none;
    font-family: 'Ubuntu Mono', monospace; /* For consistency */
    line-height: 1.04;
}
#gateone .terminal {
    line-height: 1.04;
    background-color: #222; /* Not quite black so we can use shadows :) */
    color: #eee;
    position: static;
    float: left;
    -webkit-transition: -webkit-transform 1s ease-in-out;
    -moz-transition: -moz-transform 1s ease-in-out;
    -ms-transition: -ms-transform 1s ease-in-out;
    -o-transition: -o-transform 1s ease-in-out;
    transition: transform 1s ease-in-out;
}
#gateone .noanimate {
    -webkit-transition: all 0s ease-in-out;
    -moz-transition: all 0s ease-in-out;
    -ms-transition: all 0s ease-in-out;
    -o-transition: all 0s ease-in-out;
    transition: all 0s ease-in-out;
}
#gateone .terminal a {
    color: #90A3C5;
}
#gateone .terminal a:visited {
    color: #90A3C5;
}
#gateone .terminal pre {
    font-family: 'Ubuntu Mono', monospace;
    font-size: 0.9em; /* For some reason when you use a .woff font it seems to show up slightly larger than it would normally */
    line-height: 1.04;
    /*height: auto;*/ /* Needs to be 100% when scrollback is enabled */
    width: 100%;
    overflow-y: auto;
    overflow-x: hidden;
    position: absolute;
    bottom: 0;
    -webkit-transform-origin: left bottom;
    -moz-transform-origin: left bottom;
    -ms-transform-origin: left bottom;
    -o-transform-origin: left bottom;
    transform-origin: left bottom;
}
#gateone .terminal span.screen {
    word-wrap: break-word;
    white-space: pre-wrap;
/*     margin-right: 2em; */
    display: block;
}
#gateone .terminal span.scrollback {
    word-wrap: break-word;
    white-space: pre-wrap;
/*     margin-right: 2em; */
    display: block;
}

/* The &quot;reverse&quot; default needs to be set in the theme since the background will vary */
#gateone span.reverse { color: #222; background-color: #ccc; } /* Black on White */
#gateone span.cursor { color: #000; background-color: #ccc; }
#go_toolbar {
    z-index:600;
    position:absolute;
    top:0;
    right:1.6em;
    color: #fff;
    text-align: right;
}
#gateone .toolbar {
    float: right;
    clear: both;
    opacity: .75;
    margin-top: 0.3em;
    -webkit-transition: -webkit-transform 1.0s ease-in-out;
    -moz-transition: -moz-transform 1.0s ease-in-out;
    -ms-transition: -ms-transform 1.0s ease-in-out;
    -o-transition: -o-transform 1.0s ease-in-out;
    transition: transform 1.0s ease-in-out;
    margin-right: 5px;
}
#gateone .toolbar:hover {
    opacity: 1;
    cursor:pointer;
}
#gateone .toolbar:target {
    -webkit-transform:rotate(180deg);
    -moz-transform:rotate(180deg);
    -ms-transform:rotate(180deg);
    -o-transform:rotate(180deg);
    transform:rotate(180deg);
}
#go_infocontainer {
    -webkit-transition: all 2.0s ease-in-out;
    -moz-transition: all 2.0s ease-in-out;
    -o-transition: all 2.0s ease-in-out;
    transition: all 2.0s ease-in-out;
    display: block;
    position: absolute;
    bottom: 50%;
    right: 50%;
    border: 1px #FFF solid;
    background-color: #000;
    z-index: 500;
    padding: 0.5em;
}
#go_noticecontainer {
    display: block;
    position: absolute;
    bottom: 2em;
    right: 3em;
    z-index: 9999;
}
#go_noticecontainer .close_notice {
    float: right;
    opacity: .5;
    -webkit-transform: scale(.6);
    -webkit-transform-origin: right top;
    -moz-transform: scale(.5);
    -moz-transform-origin: right top;
    -ms-transform: scale(.5);
    -ms-transform-origin: right top;
    -o-transform: scale(.5);
    -o-transform-origin: right top;
    transform: scale(.5);
    transform-origin: right top;
}
#go_noticecontainer .close_notice:hover {
    cursor: pointer;
    opacity: 1;
}
#go_noticecontainer a {
    color: #90A3C5;
}
#go_noticecontainer a:visited {
    color: #90A3C5;
}
#go_terminfo {
    color: #fff;
    font-weight: bold;
    font-size: 1.1em;
}
#gateone .pastearea {
    font-family: monospace;
    display: block;
    color: transparent;
    background: transparent;
    position: absolute;
    top: 0;
    left: 0;
    bottom: 1.5em;
    padding: 0;
    right: 3em;
    z-index: 500;
    margin: 0;
    opacity: 0;
    width: 96%; /* For whatever reason Firefox needs the width/height set */
    height: 95%; /* Make room at the bottom for playback controls */
}
#gateone .pastearea:hover {
    cursor: text;
}
/* This is to work around a Chrome/Windows bug where pasting gets disabled if you use JS to set display: none */
#gateone .go_none { /* No prefix on this one because of issues with that in the JS code */
/*     display: none; */
    height: 1px;
    width: 1px;
}
#gateone .sideinfo {
    -webkit-transform: rotate(90deg);
    -webkit-transform-origin: right top;
    -moz-transform: rotate(90deg);
    -moz-transform-origin: right top;
    -ms-transform: rotate(90deg);
    -ms-transform-origin: right top;
    -o-transform: rotate(90deg);
    -o-transform-origin: right top;
    transform: rotate(90deg);
    transform-origin: right top;
    right: 1em; /* This will get overridden by a px value calculated based on the width of the scrollbar */
    bottom: 0;
    color: white;
    position: absolute;
    font-family: sans-serif;
    font-style: italic;
    font-size: 1.3em;
    opacity: 0.5;
    font-weight: bold;
    margin-bottom: -1em;
    z-index: 10;
}
#go_notice {
    -webkit-transition: all 5.0s ease-in-out;
    -moz-transition: all 5.0s ease-in-out;
    -ms-transition: all 5.0s ease-in-out;
    -o-transition: all 5.0s ease-in-out;
    transition: all 5.0s ease-in-out;
    color: #fff;
    background-color: rgba(34,34,34,0.8);
    font-weight: bold;
    font-size: 1.1em;
    border: 1px #FFF solid;
    padding: 0.5em;
    margin: 1em;
    float: right;
    clear: both;
}
#go_notice.noanimate {
    -webkit-transition: all .1s ease-in-out;
    -moz-transition: all 0.1s ease-in-out;
    -ms-transition: all 0.1s ease-in-out;
    -o-transition: all 0.1s ease-in-out;
    transition: all 0.1s ease-in-out;
}
#gateone .sidepanel {
    -webkit-transition: -webkit-transform 1.0s ease-in-out;
    -moz-transition: all 1.0s ease-in-out;
    -ms-transition: all 1.0s ease-in-out;
    -o-transition: all 1.0s ease-in-out;
    transition: all 1.0s ease-in-out;
}
#gateone .panel {
    position:absolute;
    top:1em;
    right:3.4em;
    display: block;
    background: #ccc; color: #000;
    font-family: sans-serif;
    z-index: 700; /* Same as toolbar */
    overflow-x: hidden;
    overflow-y: auto;
    padding: 0.25em;
    font-size: 1em;
    margin-top: 0.1em;
    margin-bottom: 0.1em;
    max-height: 90%; /* Ensures a scrollbar will appear if the browser window is too small to fit a panel */
    -webkit-transform: scale(0);
    -webkit-transform-origin: top right;
    -webkit-transition: all 0.5s ease-in-out;
    -moz-transform: scale(0);
    -moz-transition: all 0.5s ease-in-out;
    -moz-transform-origin: top right;
    -ms-transform: scale(0);
    -ms-transition: all 0.5s ease-in-out;
    -ms-transform-origin: top right;
    -o-transform: scale(0);
    -o-transition: all 0.5s ease-in-out;
    -o-transform-origin: top right;
    transform: scale(0);
    transform-origin: top right;
    transition: all 0.5s ease-in-out;
    box-shadow: 0.2em 0.2em 0.5em #000;
    background-image: -moz-linear-gradient(#eee, #999);
    background-image: -webkit-linear-gradient(#eee, #999);
    background-image: -ms-linear-gradient(#eee, #999);
    background-image: -o-linear-gradient(#eee, #999);
    border: 0.1em #fff outset;
    border-radius: 0.5em;
}
#gateone .panel h2 {
    font-size: 1.5em;
    border-bottom: 0.1em #000 solid;
    position: relative;
    margin-bottom: 0.2em;
    padding-right: 1em; /* Make room for the X icon */
}
#gateone .panel h3 {
    font-size: 1.2em;
    border-bottom: 0.1em #000 solid;
    position: relative;
    margin-bottom: 0.2em;
}
#gateone .panel a {
    color: #1F5470;
    text-decoration: none;
    font-weight: bold;
}
#gateone .panel a:hover {
    color: maroon;
    cursor: pointer;
}
#gateone .panel a:visited {
    color: #1F5470;
}
#gateone .paneltable {
    position: relative;
    width: 100%;
    background-color: #222;
    color: #000;
    padding-bottom: 0.5em;
    margin-bottom: 0.2em;
    border: 0.1em #000 solid;
    -webkit-box-shadow: 2px 2px 4px #888;
    -moz-box-shadow: 2px 2px 4px #888;
    box-shadow: 2px 2px 4px #888;
    background-image: -moz-linear-gradient(#fff, #ccc);
    background-image: -webkit-linear-gradient(#fff, #ccc);
    background-image: -ms-linear-gradient(#fff, #ccc);
    background-image: -o-linear-gradient(#fff, #ccc);
    background-image: linear-gradient(#fff, #ccc);
}
#gateone .paneltablerow {
    display: table-row;

    border-color: #BBB;
    border-style: solid;
    /* WebKit */
    -webkit-transition: -webkit-transform 1s ease-in-out;
    -webkit-transform: scale(.9);
    /* Firefox */
    -moz-transition: -moz-transform 1s ease-in-out;
    -moz-transform: scale(.9);
    /* IE9+ */
    -ms-transition: -ms-transform 1s ease-in-out;
    -ms-transform: scale(.9);
    /* Opera */
    -o-transition: -o-transform 1s ease-in-out;
    -o-transform: scale(.9);
    /* Future CSS3 standard */
    transition: transform 1s ease-in-out;
    transform: scale(.9);
}
